import styled from "styled-components";

const About = () => {
  return (
    <>
      <Container></Container>
    </>
  );
};

export default About;

const Container = styled.div`
  border: 5px solid skyblue;
  border-radius: 50px;
  margin-left: 15px;
  max-width: 50%;
`;
